import React from "react"
import { useTimeout } from "../CustomHooks/useTimeOut";

export default function TimeOutHook(){
    // false
    const isReady = useTimeout(5000)
    return (
      <div>
        <h3> Custom Hooks </h3>
      {/* // will show up once ready */}
        {isReady && "Ready"}
      {/* // will disappear when its ready */}
        {!isReady && "Not Ready"}
      </div>
    );
  };
